import CryptoChart from '../../Components/CryptoChart'
import { ChartDiv, Container, Overview } from './styles'

export default class Coins extends Component {
    render() {
        return (
            <Container>
                <Overview>Your overview</Overview>
                <ChartDiv>
                    <CryptoChart />
                </ChartDiv>
                <ChartDiv>Test</ChartDiv>
            </Container>
        )
    }
}
